	public static String JPGZH(String str){
		String result = str.split("base64,")[1].split("/>")[0];
		result = result.replace(" ", "+");
		return str.split("base64,")[0]+"base64,"+result+"/>"+str.split("base64,")[1].split("/>")[1];
	}
	

	/**
	 * 图片转化成base64字符串
	 * 
	 * @param imgFile
	 * @return
	 */
	public static String img2BaseStr(String imgFile) {// 将图片文件转化为字节数组字符串，并对其进行Base64编码处理
		InputStream in = null;
		byte[] data = null;
		// 读取图片字节数组
		try {
			in = new FileInputStream(imgFile);
			data = new byte[in.available()];
			in.read(data);
			in.close();
		} catch (IOException e) {
			e.printStackTrace();
		}
		// 对字节数组Base64编码
		BASE64Encoder encoder = new BASE64Encoder();
		return encoder.encode(data);// 返回Base64编码过的字节数组字符串
	}

	/**
	 * base64字符串转化成图片
	 * 
	 * @param base64str
	 * @param savepath
	 * @return
	 */
	public static boolean base2Img(String base64str, String savepath) { // 对字节数组字符串进行Base64解码并生成图片
		if (base64str == null) // 图像数据为空
			return false;
		// System.out.println("开始解码");
		BASE64Decoder decoder = new BASE64Decoder();
		try {
			// Base64解码
			byte[] b = decoder.decodeBuffer(base64str);
			// System.out.println("解码完成");
			for (int i = 0; i < b.length; ++i) {
				if (b[i] < 0) {// 调整异常数据
					b[i] += 256;
				}
			}
			// System.out.println("开始生成图片");
			// 生成jpeg图片
			OutputStream out = new FileOutputStream(savepath);
			out.write(b);
			out.flush();
			out.close();
			return true;
		} catch (Exception e) {
			return false;
		}
	}

	public static Map<String, String> createImg(String str,String id) {
		String filename = "";
		Map<String, String> map = new HashMap<String, String>();
		if (!str.equals("") && null != str) {
			if (str.indexOf("base64") > 0) {
				for (int i = 0; i < str.split("base64,").length; i++) {
					String string = str.split("base64,")[i].split("/>")[0];
					base2Img(string, url+ id +i + ".jpeg");
					filename += url + id + i + ".jpeg,";
				}
			}
			String results = str.replaceAll("\\<.*?>", "");

			if (!results.equals("")) {
				map.put("results", results);
			}
			if (!filename.equals("")) {
				map.put("filename", filename);
			}
		}
		return map;
	}

